import { useState } from "react";
import { useNavigate } from "react-router-dom";
import { supabase } from "../supabaseClient";

export default function SignupPage() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [error, setError] = useState("");
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const assets = {
    logo: "https://tccglukvhjvrrjkjshet.supabase.co/storage/v1/object/public/public-assets//ObscuraLogo.png",
    background:
      "https://tccglukvhjvrrjkjshet.supabase.co/storage/v1/object/public/public-assets//wallpaperflare.com_wallpaper%20(57).jpg",
  };

  const handleSignup = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError("");

    const { data: signupData, error } = await supabase.auth.signUp({
      email,
      password,
    });

    if (error) {
      setError(error.message);
      setLoading(false);
      return;
    }

    const user = signupData?.user;

    if (user) {
      // Check if this is the first user
      const { data: allUsers } = await supabase.from("users").select("id");
      const isFirstUser = allUsers?.length === 0;

      const { error: insertError } = await supabase.from("users").insert({
        id: user.id,
        email: user.email,
        role: isFirstUser ? "superadmin" : "user",
      });

      if (insertError) {
        console.error("Insert error:", insertError.message);
      }
    }

    setLoading(false);
    navigate("/entry");
  };

  return (
    <div
      className="min-h-screen bg-cover bg-center flex items-center justify-center px-4"
      style={{ backgroundImage: `url('${assets.background}')` }}
    >
      <div className="w-full max-w-md bg-white/90 backdrop-blur-md rounded-2xl shadow-2xl p-8 text-center">
        {/* Logo */}
        <img
          src={assets.logo}
          alt="Obscura Logo"
          className="h-16 mx-auto mb-4"
        />

        <h2 className="text-3xl font-bold mb-6 text-gray-800">Create an Account</h2>
        {error && <p className="text-red-500 mb-4 text-sm">{error}</p>}

        <form onSubmit={handleSignup} className="space-y-4 text-left">
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">
              Email
            </label>
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              className="w-full px-4 py-2 border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500 focus:outline-none"
              required
              placeholder="you@example.com"
            />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">
              Password
            </label>
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              className="w-full px-4 py-2 border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500 focus:outline-none"
              required
              placeholder="Minimum 6 characters"
            />
          </div>
          <button
            type="submit"
            disabled={loading}
            className="w-full bg-blue-600 text-white py-2 rounded-lg font-semibold hover:bg-blue-700 transition"
          >
            {loading ? "Signing up..." : "Sign Up"}
          </button>
        </form>

        <p className="mt-4 text-sm text-gray-600">
          Already have an account?{" "}
          <a href="/" className="text-blue-500 hover:underline">
            Log in here
          </a>
        </p>

        {/* Social Icons (optional) */}
        <div className="flex justify-center space-x-6 mt-6">
          <a href="https://youtube.com" target="_blank" rel="noreferrer">
            <img
              src="https://tccglukvhjvrrjkjshet.supabase.co/storage/v1/object/public/public-assets//youtube.png"
              alt="YouTube"
              className="h-6 w-6 hover:scale-110 transition rounded-full"
            />
          </a>
          <a href="https://facebook.com" target="_blank" rel="noreferrer">
            <img
              src="https://tccglukvhjvrrjkjshet.supabase.co/storage/v1/object/public/public-assets//Facebook.png"
              alt="Facebook"
              className="h-6 w-6 hover:scale-110 transition rounded-full"
            />
          </a>
          <a href="https://tiktok.com" target="_blank" rel="noreferrer">
            <img
              src="https://tccglukvhjvrrjkjshet.supabase.co/storage/v1/object/public/public-assets//TikTok.png"
              alt="TikTok"
              className="h-6 w-6 hover:scale-110 transition rounded-full"
            />
          </a>
        </div>
      </div>
    </div>
  );
}
